//console.log(text);
document.body.innerHTML = text;

function generate_classification(classification, first=true) {
    if (first) {
        text = "<ul>";
    } else {
        text = "<ul class=\"treelist\">";
    }
    for (name in classification) {
        if (name == "emojis") {
            text += "<li>";
            for (i = 0; i < classification[name].length; i++) {
                var emoji = classification[name][i];
                text += '<button class="select" name=' + emoji + ' onclick="select_emoji(this)"><img src=' + emojis[emoji] + ' class="selector" /></button>';
            }
            text += "</li>";
        } else {
            text += "<li>" + name;
            text += generate_classification(classification[name], false);
            text += "</li>";
        }
    }
    return text + "</ul>";
}

treeLists = document.getElementsByTagName("ul");
//console.log(treeLists);
for (var i=0; i < treeLists.length; i++) {
    treeLists[i].addEventListener("click", function() {
        //console.log(this);
        this.parentElement.querySelector(".treelist").classList.toggle("active");
    });
}